import React from "react";
import Card from "./Card";


const Service = () =>{
    return (
        <>
        <div className="">
            <h1>OUR SERVICES</h1>
        </div>
        <div className="container-fluid">
            <div className="row">
                <div className="col-10 col-lg-6 mx-auto">
                    <Card/>
                </div>
            </div>
        </div>
        </>
    )
}

export default Service;
